import { useEffect } from "react";
import * as React from 'react';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { Box, Typography } from "@mui/material";

function Info() {
  const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
      backgroundColor: theme.palette.primary.main,
      color: "black",
      padding: "20px",
      textAlign: "center",
    },
    [`&.${tableCellClasses.body}`]: {
      fontSize: 14,
      whiteSpace: "nowrap",
      textAlign: "center",
    },
  }));

  const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
    },
    '&:last-child td, &:last-child th': {
      border: 0,
    },
  }));

  function createData(day: string, morning: string, afternoon: string) {
    return { day, morning, afternoon };
  }

  const rows = [
    createData('Lundi', "8h30 / 12h00", "13h30 / 18h00"),
    createData('Mardi', "8h30 / 12h00", "13h30 / 18h00"),
    createData('Mercredi', "8h30 / 12h00", "13h30 / 18h00"),
    createData('Jeudi', "8h30 / 12h00", "13h30 / 18h00"),
    createData('Vendredi', "8h30 / 12h00", "13h30 / 18h00"),
    createData('Samedi', "8h30 / 12h00", "Fermé"),
    createData('Dimanche', "Fermé", "Fermé"),
  ];

  let map: google.maps.Map;

  async function initMap(): Promise<void> {
    const { Map } = (await google.maps.importLibrary("maps")) as google.maps.MapsLibrary;
    const { Marker } = (await google.maps.importLibrary("marker")) as google.maps.MarkerLibrary;

    const biblioCoords = { lat: 45.63362503051758, lng: 0.16546398401260376 };

    map = new Map(document.getElementById("map") as HTMLElement, {
      center: biblioCoords,
      zoom: 15,
    });

    new Marker({
      position: biblioCoords,
      map: map,
      title: "Bibliothèque de Nico",
    });
  }

  useEffect(() => {
    initMap();
  }, []);

  return (
    <>
      <Box
        sx={{
          mt: 3,
          textAlign: "center",
          p: { xs: 3, md: 6 },
          width: "90%",
          mx: "auto",
        }}
      >
        <Typography variant="h2" color="text.primary" fontWeight="bold" gutterBottom>
          Bienvenue à la Bibliothèque Biblio Go
        </Typography>

        <Typography variant="body1" color="text.secondary" sx={{ whiteSpace: "pre-line" }}>
          Située au cœur de votre ville, Biblio Go est bien plus qu’une simple bibliothèque : <br />
          c’est un lieu de culture, de rencontre et de partage ouvert à tous. <br />
          Nous mettons à votre disposition des milliers d’ouvrages. <br />
          Nos espaces de lecture et de travail sont pensés pour offrir un environnement calme et accueillant. <br />
          Grâce à notre plateforme en ligne, vous pouvez réserver vos livres à distance, puis venir les retirer en drive en toute simplicité.
          Vos ouvrages sont préparés en moins de deux heures et disponibles 24h/24 et 7j/7 dans nos bornes automatiques de retrait et de dépôt. <br />
          Que vous soyez un lecteur passionné, un étudiant ou un parent souhaitant initier ses enfants à la lecture, Biblio Go vous accueille et vous accompagne dans toutes vos découvertes littéraires.
        </Typography>
      </Box>

      <div style={{ display: "flex", flexDirection: "column", gap: "10px", width: "100%", alignItems: "center", padding: "20px", minHeight: "100%" }}>
        <div style={{ display: "flex", width: "100%", gap: "20px", justifyContent: "center", flexWrap: "wrap", padding:"20px" }}>
          {/* Table MUI */}
          <TableContainer component={Paper} sx={{ flex: 1, minWidth: "340px", maxWidth:"400px" }}>
            <Table sx={{ height: "100%" }} aria-label="horaires table" size="small">
              <TableHead>
                <TableRow>
                  <StyledTableCell>Jour</StyledTableCell>
                  <StyledTableCell>Matin</StyledTableCell>
                  <StyledTableCell>Après-midi</StyledTableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {rows.map((row) => (
                  <StyledTableRow key={row.day}>
                    <StyledTableCell component="th" scope="row">{row.day}</StyledTableCell>
                    <StyledTableCell>{row.morning}</StyledTableCell>
                    <StyledTableCell>{row.afternoon}</StyledTableCell>
                  </StyledTableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>

          <div
            id="map"
            aria-label="Carte google de la bibliothèque"
            style={{
              flex: 0.8,
              minWidth: "340px",
              height: "400px",
              borderRadius: "10px",
            }}
          />
        </div>
      <h2>Suivez-nous</h2>
      <div
      style={{
        display:"flex",
        justifyContent:"center",
        alignItems:"center",
        gap:"20px", 
        backgroundColor:"white",
        borderRadius:"15px"
      }}
      >
        <img style={{height:"44px", width:"44px", marginLeft:"18px"}} src="data:image/jpeg;base64," alt="" />
        <img style={{height:"52px", width:"54px"}}  src="data:image/jpeg;base64," alt="" />
        <img style={{height:"50px", width:"50px"}}  src="data:image/png;base64," alt="" />
        <img style={{height:"50px", width:"55px", marginRight:"10px"}}  src="data:image/jpeg;base64," alt="" />
      </div>
    </div>
    </>
  );
}

export default Info;
